import React from "react";
import "../../constants/styles/Bootstrap.css";

const HomeListing = (props) => {
  return (
    <div className="card">
      <img alt="name of game" />
      <div className="card-body">
        <div>{props.title}</div>
        <div>{props.description}</div>
      </div>
    </div>
  );
};

export default HomeListing;
